// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import '@openzeppelin/contracts/math/SafeMath.sol';

import './libraries/FixedPoint.sol';
import './libraries/GoSwapLibrary.sol';
import './libraries/GoSwapOracleLibrary.sol';
import './libraries/Epoch.sol';
import './interfaces/IGoSwapPair.sol';

// fixed window oracle that recomputes the average price for the entire period once every period
// note that the price average is only guaranteed to be over at least 1 period, but may be over a longer period
contract GoSwapOracle is Epoch {
    using FixedPoint for *;
    using SafeMath for uint256;

    /* ========== STATE VARIABLES ========== */

    // uniswap
    /// @notice token0
    address public token0;
    /// @notice token1
    address public token1;
    /// @notice 
    IGoSwapPair public pair;

    // oracle
    /// @notice 
    uint32 public blockTimestampLast;
    /// @notice 0
    uint256 public price0CumulativeLast;
    /// @notice 1
    uint256 public price1CumulativeLast;
    /// @notice 0
    FixedPoint.uq112x112 public price0Average;
    /// @notice 1
    FixedPoint.uq112x112 public price1Average;

    /* ========== CONSTRUCTOR ========== */
    /**
     * @dev 
     * @param _company 
     * @param _tokenA TokenA
     * @param _tokenB TokenB
     * @param _period 
     * @param _startTime 
     */
    constructor(
        address _company,
        address _tokenA,
        address _tokenB,
        uint256 _period,
        uint256 _startTime
    ) public Epoch(_period, _startTime, 0) {
        // 
        IGoSwapPair _pair = IGoSwapPair(GoSwapLibrary.pairFor(_company, _tokenA, _tokenB));
        pair = _pair;
        token0 = _pair.token0();
        token1 = _pair.token1();
        // 0,1
        price0CumulativeLast = _pair.price0CumulativeLast(); // fetch the current accumulated price value (1 / 0)
        price1CumulativeLast = _pair.price1CumulativeLast(); // fetch the current accumulated price value (0 / 1)
        // 0,1
        uint112 reserve0;
        uint112 reserve1;
        // 0,1
        (reserve0, reserve1, blockTimestampLast) = _pair.getReserves();
        require(reserve0 != 0 && reserve1 != 0, 'Oracle: NO_RESERVES'); // ensure that there's liquidity in the pair
    }

    /* ========== MUTABLE FUNCTIONS ========== */

    /**
     * @dev Updates 1-day EMA price from GoSwap.
     * @dev 
     */
    function update() external checkEpoch {
        // 
        (uint256 price0Cumulative, uint256 price1Cumulative, uint32 blockTimestamp) =
            GoSwapOracleLibrary.currentCumulativePrices(address(pair));
        //  =  -  ()
        uint32 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired
        //  = 0 
        if (timeElapsed == 0) {
            // prevent divided by zero
            return;
        }

        // overflow is desired, casting never truncates
        // cumulative price is in (uq112x112 price * seconds) units so we simply wrap it after division by time elapsed
        // uq112x112*
        // 0 = ( - ) / 
        price0Average = FixedPoint.uq112x112(uint224((price0Cumulative - price0CumulativeLast) / timeElapsed));
        // 1 = ( - ) / 
        price1Average = FixedPoint.uq112x112(uint224((price1Cumulative - price1CumulativeLast) / timeElapsed));
        // 
        price0CumulativeLast = price0Cumulative;
        price1CumulativeLast = price1Cumulative;
        // 
        blockTimestampLast = blockTimestamp;
        // 
        emit Updated(price0Cumulative, price1Cumulative);
    }

    /**
     * @dev 
     * @param token token
     * @param amountIn 
     * @return amountOut 
     * @notice 0
     */
    // note this will always return 0 before update has been called successfully for the first time.
    function consult(address token, uint256 amountIn) external view returns (uint144 amountOut) {
        // tokentoken0
        if (token == token0) {
            //  = 0 *  / 2**112
            amountOut = price0Average.mul(amountIn).decode144();
        } else {
            // tokentoken1
            require(token == token1, 'Oracle: INVALID_TOKEN');
            //  = 1 *  / 2**112
            amountOut = price1Average.mul(amountIn).decode144();
        }
    }

    /**
     * @dev 
     * @param token token
     * @param amountIn 
     * @return amountOut 
     * @notice 0
     */
    // collaboration of update / consult
    function expectedPrice(address token, uint256 amountIn)
        external
        view
        returns (uint224 amountOut)
    {
        // 
        (
            uint256 price0Cumulative,
            uint256 price1Cumulative,
            uint32 blockTimestamp
        ) = GoSwapOracleLibrary.currentCumulativePrices(address(pair));
        //  =  -  ()
        uint32 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired

        // 0 = ( - ) / 
        FixedPoint.uq112x112 memory avg0 =
            FixedPoint.uq112x112(
                uint224((price0Cumulative - price0CumulativeLast) / timeElapsed)
            );
        // 1 = ( - ) / 
        FixedPoint.uq112x112 memory avg1 =
            FixedPoint.uq112x112(
                uint224((price1Cumulative - price1CumulativeLast) / timeElapsed)
            );

        if (token == token0) {
            //  = 0 *  / 2**112
            amountOut = avg0.mul(amountIn).decode144();
        } else {
            require(token == token1, 'Oracle: INVALID_TOKEN');
            //  = 1 *  / 2**112
            amountOut = avg1.mul(amountIn).decode144();
        }
        return amountOut;
    }

    /**
     * @dev 
     * @param company 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @return lpt lp Token
     */
    function pairFor(
        address company,
        address tokenA,
        address tokenB
    ) external pure returns (address lpt) {
        // tokenA tokenB
        return GoSwapLibrary.pairFor(company, tokenA, tokenB);
    }

    /**
     * @dev :
     * @param price0CumulativeLast 0
     * @param price1CumulativeLast 1
     */
    event Updated(uint256 price0CumulativeLast, uint256 price1CumulativeLast);
}

